# Creazione del grafico 'Autocorrelazione'
f2 = plt.figure(2)
plt.title("Autocorrelazione")
plt.xlim(0, 30)
plt.ylim(-0.8, 1)
plt.plot(lags, acf, color='orange', marker = 'o')
plt.xlabel('Shift in Giorni')
plt.ylabel('Coefficiente di Autocorrelazione')

plt.show()

