import random

# Funzione che calcola il nuovo punteggio ELO in base al risultato della partita
def eloRating(Ra, Rb, result, k=32):
    #Ra = punteggio Elo attuale giocatore 1
    #Rb = punteggio Elo attuale giocatore 2
    #result: risultato del match: 0-sconfitta, 0.5-pareggio, 1-vittoria


    Ea = 1/ (1+10 ** ((Rb - Ra)/400)) #punteggio atteso di A
    Eb = 1/ (1+10 ** ((Ra - Rb)/400)) #punteggio atteso di B


    Sa = Ra + k * (result - Ea) #nuovo punteggio Elo di A
    Sb = Rb + k * ((1-result) - Eb) #nuovo punteggio Elo di B

    return int(Sa), int(Sb) #la funzione ritorna una tupla contenente i nuovi punteggi ELO dei giocatori


