# Crea la tabella ROC, dati 'Observed'
data_obs = {'Dosage': ['< 2.00', '2.00 - 3.99', '4.00 - 5.99', '6.00 - 7.99', '8.00 - 9.99',
                    '10.00 - 11.99','12.00 - 13.99', '14.00 - 15.99', '16.00 - 17.99',
                    '> 18.00'],
        'Negative': [34, 74, 100, 127, 153, 114, 19, 6, 4, 0],
        'Positive': [2, 6, 10, 12, 23, 55, 75, 41, 30, 15]}

# Crea un DataFrame a partire dai dati
df = pd.DataFrame(data_obs)

# Effettua la somma dei valori nella colonna "Negative" e "Positive"
somma_neg_obs = np.sum(data_obs['Negative'])
somma_pos_obs = np.sum(data_obs['Positive'])

# Crea la tabella ROC, dati 'Cumulative'
CUM_Negative = [0]
CUM_Positive = [0]
fpr = []
tpr = []
auc = []

# Funzione per calcolare i dati cumulativi negativi
def cum_neg(point):
    f = CUM_Negative[point]
    d = df['Negative'][point]
    b = f + d
    CUM_Negative.append(b)

# Funzione per calcolare i dati cumulativi positivi
def cum_pos(point):
    f = CUM_Positive[point]
    d = df['Positive'][point]
    b = f + d
    CUM_Positive.append(b)

# Numero di elementi presenti in nella colonna dei valori 'Observed negative'
Num_eleme_obs_neg = len(data_obs['Negative'])

for valore in range(Num_eleme_obs_neg):
    cum_neg(valore)
    cum_pos(valore)

# Definisce le variabili che contengono i valori cumulativi negativi e positivi massimi
max_cum_neg = max(CUM_Negative)
max_cum_pos = max(CUM_Positive)

# Numero di elementi presenti in nella colonna dei valori 'cumulativi negativi'
Num_eleme_cum_neg = len(CUM_Negative)

# Calcola i valori 'cumulativi del False Positive Rate (FPR)'
for elements in range(Num_eleme_cum_neg):
    nump = CUM_Negative[elements]
    formule = 1-(nump/max_cum_neg)
    dec = round(formule, 3) #valori precisi dei deciamli (3 valori dopo la virgola)
    fpr.append(dec)

# Calcola i valori 'cumulativi del True Positive Rate (TPR)'
for number in range(Num_eleme_cum_neg):
    nump = CUM_Positive[number]
    formule = 1 - (nump/max_cum_pos)
    dec = round(formule, 3)
    tpr.append(dec)

# Numero di elementi presenti in FPR e TPR
Num_elementi_FPR = len(fpr)
Num_elementi_TPR = len(tpr)

# Funzione per il calcolo di AUC
def auc_cum(point):
   num = point
   num1 = point + 1
   value1 = fpr[num]
   if  num1 < Num_elementi_FPR:
       value2 = fpr[num1]
   else :
       value2 = 0
   value3 = tpr[point]
   formula = (value1 - value2)*value3
   dec = round(formula, 3)
   auc.append(dec)

for numero in range(Num_elementi_FPR):
    auc_cum(numero)

# Calcola la somma di tutti i valori presenti nella colonna di AUC
somma = np.sum(auc)

# Stampa
data_cum_neg_pos = {'Negative': CUM_Negative,
    'Positive': CUM_Positive}

data_cum_FPR_TPR_AUC = {'FPR': fpr,
    'TPR': tpr,
    'AUC': auc}

df2 = pd.DataFrame(data_cum_neg_pos)
df3 = pd.DataFrame(data_cum_FPR_TPR_AUC)

# Stampa della tabella ROC
print("Observed:\n", df)
print("somma observed negative:", somma_neg_obs)
print("somma observed positive:", somma_pos_obs)
print("Cumulative:\n",df2)
print(df3)
print("somma AUC:", somma)

# Crea il grafico della curva ROC
plt.title("Curva ROC per il nuovo Vaccino Nasale")
plt.xlim(0.0, 1.000)
