# Calcola l'entropia dello stato attuale H(S)
def entropy(y):
    class_counts = y.value_counts()
    total_samples = len(y)
    entropy = 0
    for count in class_counts:
        probability = count / total_samples
        entropy += -probability * math.log2(probability)
    return entropy

entropy_s = entropy(val)
print("Entropia dello stato attuale H(S):", entropy_s)

# Calcola il guadagno di informazione IG(S,x)
def information_gain(feature, y):
    unique_values = feature.unique()
    total_samples = len(feature)
    entropy_s_x = 0
    for value in unique_values:
        subset_y = y[feature == value]
        subset_size = len(subset_y)
        entropy_s_x += (subset_size / total_samples) * entropy(subset_y)
    return entropy_s - entropy_s_x

information_gains = {}
for column in feature.columns:
    information_gains[column] = information_gain(feature[column], val)
print("Guadagni di informazione:", information_gains)

# Selezione del nodo con il valore massimo di IG
selected_node = max(information_gains, key=information_gains.get)
print("Nodo selezionato:", selected_node)

# Rimuove l'attributo con il più alto guadagno di informazione dal set di attributi
feature = feature.drop(selected_node, axis=1)
print("Attributo rimosso:", selected_node)
print("Set di attributi aggiornato:", feature)

